import React from 'react';
import './ReactmainLink.css' ;

const ReactMainLink = () => {
    return (
      <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
    )
  };

  export default ReactMainLink;
